import "./CoouponScreen.css";

const CouponScreen=()=>{
return(
<div>

<div class="container">
  <img src="bandmember.jpg" alt="Avatar" width="20vw"></img>
  <p><span>Chris Fox.</span> CEO at Mighty Schools.</p>
  <p>John Doe saved us from a web disaster.</p>
</div>

<div class="container">
  <img src="avatar_g2.jpg" alt="Avatar" width="20vw"></img>
  <p><span >Rebecca Flex.</span> CEO at Company.</p>
  <p>No one is better than John Doe.</p>
</div> 

</div>
)};

export default CouponScreen;
